import React from "react";

import SearchBar from "./Components/search-bar";
class PageHome extends React.Component {
  render() {
    return (
      <div className="container">
        <div className="row">
          <div className="col-md-3">
            <div className="col-md-6">
              <SearchBar />
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default PageHome;
